  "id_str" : "8157586534",
  "text" : "計算空間⇔計算空間は強い完全性をもつ。現実空間⇔現実空間は弱い完全性をもつ。現実空間⇔計算空間は、今のところ、多くのケースで境界再現性を満たせるようにはなってきているが、まだ出来ていないケースもある。 [lab]",
  "id" : 8157586534,
  "created_at" : "Sun Jan 24 18:19:05 +0000 2010",
