  "text" : "「完全に同一な現象が再現出来る」という意味での完全性は「強い再現完全性」で、「代表値を抽出したときにその値に大きな剥離がない」ことが「弱い再現完全性」。水面の変動や連続体の破壊の再現性はそれよりも弱くて「境界再現性」とでも言えばいいんだろうか。 [lab]",
  "id" : 8157175687,
