  "geo" : {
  },
  "id_str" : "8139442781",
  "text" : "映画『マトリックス』みたいな、その中で人が違和感なく生活できるようなレベルでの「正しい物理計算」は、多分自分が死ぬまでには出来る気がする。 [lab]",
