  "id_str" : "8139235978",
  "text" : "まぁ、doubleだろうがfloatだろうが、非線形現象の完全な予測は不可能なのも事実なわけで、どうしたって今の考え方のままじゃ限界は見えてるんだけども。 [lab]",
