  "text" : "@Kei_Kei んー・・・まぁ、それは見る人がどれだけその現象に慣れてるかっていうのに依存しそうですけど。いつも船に乗ってる漁師さんと大根作ってる農家の人では、船の揺れかたを見て感じる違和感はぜんぜん違うト思うし。 [lab]",
