  "id_str" : "8138615281",
  "text" : "所詮、普通の人間の感覚じゃ「この水がこのまま流れたら、この壁にぶつかって、上に跳ね上がるんだろうなー」ぐらいまでしか分からないと思う。どれだけの量がどこまで跳ね上がるか分かる人って多分いない。 [lab]",
