  "text" : "あるところから水を流して、右の分岐にたくさん水が流れてるように計算できればいいのが「それっぽい」で、右にどれだけの量がどれだけの速度で流れ込んでくるかまで計算するのが計算力学、かなー・・・。 [lab]",
