  "text" : "というか、あくまで「多分」だけど、SPHなりMPSなり粒子法を「それっぽく見せる」という目的で使ってる人たちは、FTSじゃなくてDNSしてるってこともあんまり考えてないんじゃないかなぁ・・・。乱流モデルなんてなくてもそれっぽく見せることは可能だし。 [lab]",
