  "id_str" : "8137995335",
  "text" : "自分らは（究極目標として）現実世界のエミュレートを目指しているんだけど、「きれいにそれっぽく見せる」って人たちは、（不完全な）シミュレートで満足してるというか、むしろ現実っぽく見せるためには数値的におかしいことをわざとやったりしてる感じ。 [lab]",
  "id" : 8137995335,
  "created_at" : "Sun Jan 24 04:48:35 +0000 2010",
