  "text" : "「それっぽい」って非常に粗くて、人間って多少変な風に見せられても脳内で勝手に補間するし、別にきちんと数値計算する必要は全然ない。時間差分にルンゲクッタ使わずにただの風下差分で十分だったり。 [lab]",
  "id" : 8137838413,
  "created_at" : "Sun Jan 24 04:43:30 +0000 2010",
