  "text" : "本名でやってみた：「型にはまった仕事を毎日繰り返すことは堪えられません。発展性や流動性のある仕事を好みます。また､知性や感性の発揮できる仕事に取り組みます。調査・研究･開発･設計・企画・情報管理などの仕事が向いています。 」 [lab]",
