  "text" : "しかしそれでも、そんな理を吹き飛ばすほどの感情も存在するのですよ QT @asuimi だからTPOをわきまえて告白しようと前のついーとに書いたのです。 RT @showgo 相手との関係性を考えずに告白するのは恋愛の名を借りた暴力 http://bit.ly/8Gh2vk...",
