  "geo" : {
  },
  "id_str" : "7371695537",
  "text" : "ふみ、なんだか久しぶりにまじめな話を書いたのでつかれた。お茶かなにか飲んでさっさと寝よう。今日は多分、今日（昨日）あったことの関連の夢を見るだろうな。",
