  "id_str" : "7370503041",
  "text" : "過去のことは過去のことなんだ。過去がずっとそうだったからって言って、未来がそうとは限らない。例え過去10年が線形だったとしても、次の1年も線形だとは限らない。そもそも連続性や微分可能性（滑らかさ）でさえ不明なのだから、外挿なんて無理。",
